import logo from './logo.svg';
import './App.css';
import { BrowserRouter, Routes, Route} from 'react-router-dom';
import Profile from './pages/Profile.jsx';
import Main from './pages/Main.jsx';
import Calender from './pages/Calender.jsx';
import SavedFiles from './pages/SavedFiles.jsx';
import About from './pages/About.jsx';
import MailCard from './components/mail_list/MailCard.jsx';
import { list } from './components/mail_list/MailList.jsx';
import MailContent from './components/mail_list/MailContent.jsx';


function App() {
	console.log(<MailCard/>);
	return (
	<BrowserRouter>
		<Routes>
			<Route path="/" element={<Main mail={null}/> } />
			<Route path="/profile/" element={<Profile/> } />
			<Route path="/calender/" element={<Calender/>} />
			<Route path="/savedfiles/" element={<SavedFiles/>} />
			<Route path="/about/" element={<About/>} />
			{list.map(mail=>(
				<Route path="/mail/:id"  element={<Main mail={mail}/>}/>
			))}
		</Routes>
  	</BrowserRouter>
  );
}

export default App;
